import React, { Component } from 'react';
import { Card } from 'antd';

class Detail extends Component {

	constructor(props) {
		super(props);
		this.state={
			title: 'title',
			content: 'content'
		}
	}

	render() {
		return(
			<Card 
				title={this.state.title}
				extra={<a href="#">More</a>} 
				style={{ width: 300 }}
			>
      			<p>Card content</p>
      			<p>Card content</p>
      			<p>Card content</p>
    		</Card>
		)
	}
}

export default Detail;
